import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


let curDate = new Date();
curDate = curDate.getHours();

let greeting ="";

if(curDate>= 1 && curDate < 12){
  greeting = "Good Morning";
}


ReactDOM.render(
  <React.StrictMode>
    <h1>Heelo , {greeting}</h1>    
  </React.StrictMode>,
  document.getElementById('root')
);
